    false,nt"url": null,nt"notes": "EarthData International collected ADS-40/ISTAR-derived
    orthophotos at a 50 centimeter pixel resolution to produce natural color and color
    infrared ortho photo tiles. The period of aerial collection was 14 DEC 2004 to 15
    DEC 2004 with a reflight of several lines conducted on 1 FEB 2006. During the time
    of image acquisition two dual frequency GPS receivers were utilized. One receiver
    was operated on board the aircraft with the dual frequency antenna located directly
    over the camera. The second receiver was used as a base station.These receivers
    were in constant operation during the imagery mission and GPS phase data was collected
    at an epoch rate of 1 second. The airborne GPS data and IMU were used in combination
    with ground surveyed points to control the imagery. The imagery fully encompasses
    the project boundary. The DTM deliverable for this project was manually compiled
    using stereo pairs generated from the orthophoto flight. The DEM masspoint grid
    used to rectify the orthophotography was derived from the compiled DTM. All data
    produced for this project was referenced horizontally to NAD83, and vertically to
    Mean Sea Level(MSL), NAVD 88 in UTM meters.",nt"license_title": null,nt"extras":
